class ProfileContainer extends React.Component{

    componentDidMount() {
        axios.get(`http://localhost:8000/pokemons/?_limit=1&_page=100`)
          .then(response => {
              debugger;
            this.props.setPokemonProfile(response.data);
          });
      }

    render() {
        return(
            <Profile {...this.props}/>
        )
    }

}

